import React from "react";
import {
  FaBars,
  FaCommentAlt,
  FaRegChartBar,
  FaShoppingBag,
  FaUserAlt,
} from "react-icons/fa";

const Slidebar = () => {
  const menuItem = [
    {
      path: "/",
      name: "Dashboard",
      icon: "",
    },
    {
      path: "/academics",
      name: "Academics",
      icon: <FaUserAlt />,
    },
    {
      path: "/examination",
      name: "Examination",
      icon: <FaRegChartBar />,
    },
    {
      path: "/finance",
      name: "Finance",
      icon: <FaCommentAlt />,
    },
    {
      path: "/hostel",
      name: "Hostel",
      icon: <FaShoppingBag />,
    },
  ];
  return (
    <div className="container">
      <div className="sidebar">
        <div className="top_section">
          <h1 className="log0">logo</h1>
          <div className="bars">
            <FaBars />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Slidebar;
